import React from "react"
import { NavLink } from "react-router-dom"

import fflogo from "../images/ff-logo.svg"

import {
  Segment,
} from "semantic-ui-react"


const Footer = () => {
  return (
    <div id="footer">
        <Segment color='black'>Fortisure impor</Segment>
    </div>
  )
}

export default Footer
